def getMissing(association):
	letters = LETTERS[:]
	possible_values = LETTERS[:]
	for letter in association.keys():
		letters.remove(letter)
		possible_values.remove(association[letter])

	print('KEYS:', letters)
	print('VALUES:', possible_values)


def decodeList(url_list):
	assossiation = {}
	for image in url_list:
		for (c, d) in zip(image['cypher'], image['decoded']):
			if c in assossiation and assossiation[c] != d:
				print('ERROR:', image['url'])
				exit(1)

			assossiation[c] = d

	print(assossiation, '\n')
	return assossiation


